import React, {FC} from 'react';

interface CardText {
    width:string,
    height:string,
}
export const Card:FC<CardText>=({
    width,
    height,
    children,
})=>{
    return (
        <div style={{width, height, border: '1px solid gray' }}>
            {children}
        </div>
    );
};
